import {reqGetTradeList} from '@/api'
const actions={
    
    //获取交易清单商品
   async getTradeList({commit}){
        let result=await reqGetTradeList()
        commit('getTradeList',result.data)
    }
}
const mutations={
    getTradeList(state,data){
        state.tradeList=data
    }
}
const state={
    tradeList:{}
}
const getters={}
export default{
    state,
    actions,
    mutations,
    getters
}
